    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    NWR and Izembek Bay Area outlines Refuge accomplishments from January through March
    of 1961. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes Refuge visitors, Refuge participation, fishing, and safety. N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
